import React, { Component } from 'react'
import ListProfiles from '../Profile/ListProfile'

class Results extends Component {
  constructor(props) {
    super(props)
  }
  render() {
    console.log(this.props)
    return (
      <div>
        <ListProfiles query = { this.props.location.search.substr(2) }/>
      </div>
    )
  }
}

export default Results
